@tpendragon and I did the following to test setting schema in staging. It worked:
```
drop schema public;
ALTER SCHEMA dss_staging RENAME TO public;

```
We ran it in production to update the schema as well:
```
drop schema public;
ALTER SCHEMA dss_production RENAME TO public;
```

